async () => {
  await Promise.all([getAllRepos.run(), getMetrics.run(), storeValue(InitUtils.FAILURES_COUNT, undefined), storeValue('PR_' + InitUtils.FAILURES_COUNT, undefined), storeValue(InitUtils.PR_DETAILS_DATA, undefined)]);
  await fetchLast100PRruns.run();
  await getPRMetaRuns.run();
  await getLastReleaseRuns.run();
  const runIdValue = appsmith.URL.queryParams.runId ?? Utils.getRunIdAttemptOptions()?.[0]?.value;
  await Promise.all([getRunData.run({
    runId: runIdValue
  }), getLatestReleaseMean.run({
    metaId: Utils.getMinimumRunMetaId(runIdValue)
  }), getShortTermReleaseMean.run({
    metaId: Utils.getMinimumRunMetaId(runIdValue)
  }), getCombinedRunData.run({
    runId: runIdValue
  })]).then(data => {
    return storeValue(InitUtils.PR_DETAILS_DATA, {
      runData: data[0],
      latestReleaseMean: data[1],
      shortTermMean: data[2],
      combinedRunData: data[3]
    });
  }).catch(data => {
    return storeValue(InitUtils.PR_DETAILS_DATA, undefined);
  });
  await InitUtils.checkCombinedRunData();
  getPrDetails.run();
}
